import React, { Component } from "react";

class AlphaButton extends Component {
	static defaultProps = {
		chars: ["abcdefghijklmnopqrstuvwxyz".split("")],
	};
	render() {
		return (
			<div>
				<p>{this.props.chars}</p>
        {
          this.props.chars.map()
        }
			</div>
		);
	}
}

export default AlphaButton;
